var documenterSearchIndex = {"docs":
[{"location":"index.html#FinEtools-(Finite-Element-tools)-Documentation-1","page":"Home","title":"FinEtools (Finite Element tools) Documentation","text":"","category":"section"},{"location":"index.html#Conceptual-guide-1","page":"Home","title":"Conceptual guide","text":"","category":"section"},{"location":"index.html#","page":"Home","title":"Home","text":"The construction of the toolkit is described: the composition of modules, the basic data structures, the methodology of computing quantities required in the finite element methodology, and more.","category":"page"},{"location":"index.html#","page":"Home","title":"Home","text":"Pages = [\n    \"guide/guide.md\",\n]\nDepth = 1","category":"page"},{"location":"index.html#Manual-1","page":"Home","title":"Manual","text":"","category":"section"},{"location":"index.html#","page":"Home","title":"Home","text":"The description of the types and the functions, organized by module and/or other logical principle.","category":"page"},{"location":"index.html#","page":"Home","title":"Home","text":"Pages = [\n    \"man/types.md\",\n    \"man/functions.md\",\n]\nDepth = 2","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Table of contents","category":"page"},{"location":"guide/guide.html#Guide-1","page":"Guide","title":"Guide","text":"","category":"section"},{"location":"guide/guide.html#Modules-1","page":"Guide","title":"Modules","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The FinEtools package consists of many modules which fall into several  categories. The top-level module, FinEtools, includes all other modules and exports functions to constitute the public interface. The user is free to generate their own public interface, however. More details are provided Make up your own public interface.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Top-level:    FinEtools is the  top-level module.  For interactive use it is enough to do using FinEtools, however in some  cases functions from modules need to be  brought into the scope individually (most importantly, the algorithm modules). This is the ONLY  module that EXPORTS  functions, none of the other modules exports a single function. The entire  public (i. e. exported) interface of the FinEtools package is specified  in the file FinEtools.jl (i. e. in the FinEtools module). The user is free to specify his or her own set of exported functions from the FinEtools package to create an ad hoc public interface.\nUtilities:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"FTypesModule (types), PhysicalUnitModule (definitions of  numbers with physical units), AssemblyModule (assembly of elementwise matrices and vectors),   CSysModule (coordinate system module),    MatrixUtilityModule (utilities for operations on elementwise matrices), BoxModule  (support for working with bounding boxes),  ForceIntensityModule (force-intensity module),        RotationUtilModule (support for spatial rotations).","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Mesh  entities: FENodeSetModule, FESetModule (node set and finite element set  types).  \nMesh Generation:  MeshLineModule,  MeshQuadrilateralModule,   MeshTriangleModule,   MeshTetrahedronModule,             TetRemeshingModule,  VoxelTetMeshingModule,     MeshHexahedronModule,       VoxelBoxModule.  \nMesh manipulation:  MeshSelectionModule (searching of nodes  and elements),  MeshModificationModule (mesh boundary, merging  of meshes and nodes, smoothing, partitioning),  MeshUtilModule (utilities), FENodeToFEMapModule (search structure from nodes to elements).\nMesh import/export:  MeshImportModule,  MeshExportModule.\nFields:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"FieldModule,    GeneralFieldModule, ElementalFieldModule,    NodalFieldModule (modules for representing quantities on the mesh).","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Support for  integration over solids, surfaces, curves, and points:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"IntegRuleModule,   IntegDomainModule.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"General algorithms: AlgoBaseModule (algorithms), FEMMBaseModule (FEM machine for general tasks).\nHeat conduction: AlgoHeatDiffModule (algorithms), FEMMHeatDiffModule, FEMMHeatDiffSurfModule  (FEM machines  to evaluate  the  matrix and vector quantities), MatHeatDiffModule  (heat diffusion material)\nAcoustics: AlgoAcoustModule (algorithms), FEMMAcoustModule, FEMMAcoustSurfModule (FEM machines to evaluate the matrix and vector quantities),  MatAcoustFluidModule (acoustic fluid material).\nLinear deformation:  AlgoDeforLinearModule (algorithms), DeforModelRedModule,","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"FEMMDeforLinearBaseModule,  FEMMDeforLinearModule, FEMMDeforLinearMSModule,  FEMMDeforWinklerModule (FEM machines to evaluate the matrix and vector quantities), MatDeforModule, MatDeforElastIsoModule, MatDeforElastOrthoModule (elastic material models).","category":"page"},{"location":"guide/guide.html#Arithmetic-types-1","page":"Guide","title":"Arithmetic types","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The FinEtools package is fairly strict about typing arguments. The arithmetic types used throughout are FInt for integer data, FFlt for floating-point data, and Complex{FFlt} for applications that work with complex linear algebra quantities.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The module FTypesModule defines these types, and also defines abbreviations for vectors and matrices with entries of these types.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Some algorithms expect input in the form of the data dictionary, FDataDict, and also produce output in this form.","category":"page"},{"location":"guide/guide.html#Physical-units-1","page":"Guide","title":"Physical units","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The PhysicalUnitModule provides a simple function, phun, which can help with providing input numbers with the correct conversion between physical units. For instance, it is possible to specify the input data as","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"E = 200*phun(\"GPa\");# Young's modulus\nnu = 0.3;# Poisson ratio\nrho = 8000*phun(\"KG*M^-3\");# mass density\nL = 10.0*phun(\"M\"); # side of the square plate\nt = 0.05*phun(\"M\"); # thickness of the square plate","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The usual sets of units are included, :US, :IMPERIAL, :CGS, :SIMM (millimeter-based SI units), and :SI (meter-based SI units). The resulting  values assigned to the variables are floating-point numbers, for instance","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"julia> E = 200*phun(\"GPa\")\n2.0e11","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Numbers output by the simulation can also be converted  to appropriate units for printing as","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"julia> E/phun(\"MPa\")\n200000.0","category":"page"},{"location":"guide/guide.html#Mesh-entities-1","page":"Guide","title":"Mesh entities","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The mesh consists of one set of finite element nodes  and one or more sets of finite elements.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"One of the  organizing principles of the  finite element collection  is that  finite elements can appear as representations of the interior  of the domain, but in a different model as parts of the boundary.  Thus  for instance  4-node  quadrilaterals  are finite elements that represent cross-sections of  axially symmetric models or surfaces  of membranes,  but they are also the boundaries of hexahedral  models.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"A mesh  is generated by one of the functions specialized to a particular finite element type. Thus there are  mesh generation functions for lines, triangles, quadrilaterals, tetrahedra, and hexahedra.","category":"page"},{"location":"guide/guide.html#Mesh-generation-1","page":"Guide","title":"Mesh generation","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"As an example,  the following code generates a hexahedral mesh of simple rectangular block.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"fens, fes  = H8block(h, l, 2.0 * pi, nh, nl, nc)","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The finite element node set and the finite element set  are returned. More complicated meshes can be constructed from such mesh parts. There are  functions for  merging  nodes  and even multiple meshes together.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The code snippet below  constructs the mesh of an  L-shaped  domain  from  the meshes of three rectangles.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"W = 100. # width of the leg\nL = 200. # length of the leg\nnL = 15 # number of elements along the length of the leg\nnW = 10 # number of elements along the width\ntolerance = W / nW / 1.0e5 # tolerance for merging nodes\nMeshes = Array{Tuple{FENodeSet,FESet},1}()\npush!(Meshes, Q4quadrilateral([0.0 0.0; W W], nW, nW))\npush!(Meshes, Q4quadrilateral([-L 0.0; 0.0 W], nL, nW))\npush!(Meshes, Q4quadrilateral([0.0 -L; W 0.0], nW, nL))\nfens, outputfes = mergenmeshes(Meshes, tolerance);\nfes = cat(outputfes[1], cat(outputfes[2], outputfes[3]))","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"As an example of the  merging  of nodes to create  the final mesh, consider the creation of  a closed hollow tube.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"fens, fes  = H8block(h, l, 2.0 * pi, nh, nl, nc) # generate a block\n# Shape into a cylinder\nR = zeros(3, 3)\nfor i = 1:count(fens)\n    x, y, z = fens.xyz[i,:];\n    rotmat3!(R, [0, z, 0])\n    Q = [cos(psi * pi / 180) sin(psi * pi / 180) 0;\n        -sin(psi * pi / 180) cos(psi * pi / 180) 0;\n        0 0 1]\n    fens.xyz[i,:] = reshape([x + Rmed - h / 2, y - l / 2, 0], 1, 3) * Q * R;\nend\n# Merge the nodes where the tube  closes up\ncandidates = selectnode(fens, box = boundingbox([Rmed - h -Inf 0.0; Rmed + h +Inf 0.0]), inflate = tolerance)\nfens, fes = mergenodes(fens, fes,  tolerance, candidates);","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The final mesh used for a simulation  consists of a single  node set and one or more finite element sets. The  finite elements may be  divided into separate sets  to  accommodate different material properties, different orientations of the material  coordinate systems, or different formulations  of the discrete model. The  assignment  of the finite elements to sets  may be based on geometrical proximity, topological connections, or some other characteristic. See the  \"mesh selection\" discussion for details.","category":"page"},{"location":"guide/guide.html#Structured-mesh-generation-1","page":"Guide","title":"Structured mesh generation","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The simplest possible meshes can be generated in the form of one-dimensional, two-dimensional, and three-dimensional blocks. The spacing of the nodes can be either uniform (for instance Q8block), or the spacing can be given with an arbitrary distribution (for instance Q4blockx). Meshes of tetrahedra can be generated in various orientations of the \"diagonals\".","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"More complex meshes can be generated for certain element types: for instance an annulus (Q4annulus), quarter of a plate with a hole (Q4elliphole), quarter of a sphere (H8spheren), layered plate (H8layeredplatex).","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Hexahedral meshes can also be created by extrusion of  quadrilateral meshes (H8extrudeQ4).","category":"page"},{"location":"guide/guide.html#Shaping-1","page":"Guide","title":"Shaping","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Simple meshes  such as blocks can be deformed into geometrically complex shapes, for instance  by tapering  or oother relocation of the nodes. For instance, we can generate a block  and then bend it  into one quarter  of  an annulus as","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"fens,fes = Q4block(rex-rin,pi/2,5,20);\nfor i=1:count(fens)\n    r=rin+fens.xyz[i,1]; a=fens.xyz[i,2];\n    fens.xyz[i,:]=[r*cos(a) r*sin(a)];\nend","category":"page"},{"location":"guide/guide.html#Merging-1","page":"Guide","title":"Merging","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Multiple mesh regions  can be generated and then merged together into a single mesh. Refer to the MeshModificationModule. Meshes can be also mirrored.","category":"page"},{"location":"guide/guide.html#Biomedical-image-mesh-generation-1","page":"Guide","title":"Biomedical image mesh generation","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The function H8voximg can generate a hexahedral mesh from a three-dimensional image (such as a CT scan). The resulting meshes can be smoothed (meshsmoothing).","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"A similar functionality  is also available for tetrahedra (T4voximg). A more sophisticated strategy is available in the VoxelTetMeshingModule module: the initial mesh can be progressively coarsened and smoothed, resulting  in a much more realistic looking geometry compared  to the initial jagged representation.","category":"page"},{"location":"guide/guide.html#Boundary-extraction-1","page":"Guide","title":"Boundary extraction","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Mesh  composed of  any element type can be passed to the function  meshboundary, and  the boundary of the mesh is extracted. As an example, the code","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"fens,fes = Q4block(rex-rin,pi/2,5,20);\nbdryfes = meshboundary(fes);","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"generates a mesh of quadrilaterals in the set fes,  and bdryfes = meshboundary(fes) finds the boundary elements of the type L2 (line elements with two nodes) and stores them in the  finite element set bdryfes.","category":"page"},{"location":"guide/guide.html#Conversion-between-element-types-1","page":"Guide","title":"Conversion  between element types","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"For any element shape  (line, triangle,  quadrilateral, hexahedron, tetrahedron) there is  the linear version and the quadratic version. Conversion routines are provided so tthat, for example, mesh can be generated as eight-node  hexahedra  and then converted  to twenty node hexahedra as","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"fens,fes = H8toH20(fens,fes)","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Other conversion routines NEEDS  TO BE WRITTEN","category":"page"},{"location":"guide/guide.html#Refinement-1","page":"Guide","title":"Refinement","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Meshes composed of some  element types can be uniformly refined. For instance, quadrilateral meshes can be refined by bisection with Q4refine.","category":"page"},{"location":"guide/guide.html#Selection-of-mesh-entities-1","page":"Guide","title":"Selection of mesh entities","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"There are many instances of problem definitions where it is important to partition meshes into subsets. As an example,  consider a tube consisting of inner ABS core and  outer fiber-reinforced  laminate  layer. The mesh may consist  of hexahedra.  This mesh would then need to be partitioned into two subsets, because the materials and the  material orientation data  are different between the two regions.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"As another example, consider a simple beam  of rectangular cross-section, clamped  at one end,  and  loaded with shear tractions at the  free end. The  entire boundary of the beam needs to be separated  into three subsets:  the first subset,  for the traction-free boundary, is ignored. The second subset, for the clamped cross-section, is extracted  and  its nodes  are used  to  formulate the essential boundary condition. The third subset is extracted and used to define an FEM machine to compute the load vector due to the shear traction.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"There are  several  ways  in which mesh entities (nodes and finite elements) can be selected. The simplest uses element labels: some mesh-generation routines label the generated elements. For example,","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"fens,fes = H8layeredplatex(xs, ys, ts, nts)","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"generates a plate-like mesh where the layers are labeled. It is therefore possible to select  the bottom-most layer as","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"rls = selectelem(fens, fes, label = 1)","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"where rls is a list of integer indexes into the  set fes, so that we can extract a subset corresponding to this layer as","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"botskin = subset(fes, rls)","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Geometrical techniques for selecting finite elements  or nodes can be based on","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"the location within or overlap  with boxes;\ndistance from  a given point;\ndistance from a given plane;\nconnectedness (selection by flooding).","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Additionally, surface-like  finite elements (quadrilaterals and triangles embedded in three dimensions, or lines embedded in two dimensions) can be selected based upon the orientation of their normal (facing  criterion).","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"As an example, consider a straight duct with anechoic termination. A triangle mesh is generated as","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"fens,fes  =  T3block(Lx,Ly,n,2);","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"and its boundary is extracted as","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"bfes  =  meshboundary(fes)","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The finite elements from the  piece of the boundary on the left parallel to the Y axis can be extracted as","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"L0 = selectelem(fens,bfes,facing = true, direction = [-1.0 0.0])","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"where the numbers of the finite elements  whose normals point in the general direction of the vector [-1.0 0.0] are returned in the integer array L0.","category":"page"},{"location":"guide/guide.html#Fields-1","page":"Guide","title":"Fields","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The structure to maintain the numbering  and values of the degrees of freedom in the mesh  is the field.","category":"page"},{"location":"guide/guide.html#Abstract-Field-1","page":"Guide","title":"Abstract  Field","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The assumption is that a field has one set of degrees of freedom per node or per element. For simplicity we will refer to the nodes and elements as entities. It assumes that concrete  subtypes of the abstract field  have the following data, one row per entity:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"values::FMat{T}: Array of the values of the degrees of freedom, one row  for each entity. All the arrays below have the same dimensions as this one.\ndofnums::FIntMat: Array  of the numbers of the free degrees of freedom. If the degree of freedom is fixed (prescribed), the corresponding entry is zero.\nis_fixed::Matrix{Bool}: Array of  Boolean flags,  true for fixed  (prescribed) degrees of freedom, false otherwise.\nfixed_values::FMat{T}: Array  of the same size and type  as  values. Its entries are only relevant  for the fixed (prescribed)  degrees of freedom.\nnfreedofs::FInt:  the total number of free degrees of freedom.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The methods defined for the abstract field  include:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Return the number of degrees of freedom and the number of entities.\nGather and scatter the system vector.\nGather elementwise  vectors or matrices of values, the degree of freedom numbers, or the fixed values of the degrees of freedom.\nSet  or clear essential boundary conditions..\nCopy a field. Clear the entries of the field.","category":"page"},{"location":"guide/guide.html#Nodal-Field-1","page":"Guide","title":"Nodal Field","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"In this case  the  abstract field is subtyped to a concrete field where the entities are nodes.","category":"page"},{"location":"guide/guide.html#Elemental-Field-1","page":"Guide","title":"Elemental Field","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"In this case  the  abstract field  is subtyped to a concrete field where the entities are the elements.","category":"page"},{"location":"guide/guide.html#General-Field-1","page":"Guide","title":"General Field","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"In this case  the  abstract field  is subtyped to a concrete field where the entities are  use-case  specific.","category":"page"},{"location":"guide/guide.html#Numbering-of-the-degrees-of-freedom-1","page":"Guide","title":"Numbering of the degrees of freedom","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The simplest method is at the moment implemented: number all free degrees of freedom, row-by-row and column-by-column, starting from 1 up to f.nfreedofs, for the field f.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The prescribed degrees of freedom are not numbered, and the prescribed degrees of freedom are marked with 0.","category":"page"},{"location":"guide/guide.html#Finite-element-1","page":"Guide","title":"Finite element","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The  finite element set is one of the basic entities in FinEtools.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The finite element set is a collection of  finite elements defined by the connectivity (collection of node numbers, listing the nodes connected by the element in  a specific order). The finite element set  provides  specialized methods  to compute values of basis functions and the values of  the gradients of the basis functions  with respect to the parametric coordinates.","category":"page"},{"location":"guide/guide.html#Element-types-1","page":"Guide","title":"Element types","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The finite element sets are instances of concrete types. Each particular shape and order of element has its own type. There are types for  linear  and quadratic quadrilaterals, for instance, FESetQ4 and FESetQ8. Each element set provides access to the number of nodes  connected by the element (nodesperelem),  the connectivity as the two dimensional array    conn,  and the  integer label vector label.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The concrete finite element set types are subtypes of the abstract type for elements of different manifold dimension (3, 2, 1, and 0), for instance for the quadrilaterals that would be AbstractFESet2Manifold. These types are in turn  subtypes of the abstract finite element set type AbstractFESet.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The concrete finite element set type provides specialized methods to compute the values of the basis functions, bfun, and methods to compute  the gradients of the basis functions with respect to the parametric coordinates, bfundpar.","category":"page"},{"location":"guide/guide.html#Finite-element-set-functions-1","page":"Guide","title":"Finite element set functions","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Methods defined for  the abstract type:\nnodesperelem: Get the number of nodes  connected  by  the finite element.\ncount:  Get the number of individual connectivities in the FE set.\nsetlabel!: Set the label of the entire finite elements set.\nconnasarray: Retrieve  connectivity  as an integer array.\nfromarray!: Set  connectivity from an integer array.\nsubset: Extract a subset of the finite elements from the given finite element set.\ncat: Concatenate the connectivities of two FE sets.\nupdateconn!: Update the connectivity after the IDs of nodes changed.\nmap2parametric: Map a spatial location to parametric coordinates.\nMethods dispatched based on the manifold type:\nmanifdim: Return the manifold dimension.\nJacobian: Evaluate the  Jacobian.\ngradN!: Compute the gradient of the basis functions with the respect to the \"reduced\" spatial coordinates.\nMethods dispatched on the concrete type:\nboundaryconn: Get boundary connectivity.\nboundaryfe: Return the constructor of the type of the boundary finite element.\nbfun: Compute the values of the basis functions at a given parametric coordinate.\nbfundpar: Compute the values of the basis function gradients at a given parametric coordinate.\ninparametric: Are given parametric coordinates inside the element parametric domain?\ncentroidparametric: Return the parametric coordinates  of the centroid of the element.","category":"page"},{"location":"guide/guide.html#Integration-1","page":"Guide","title":"Integration","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"There are two kinds of integrals in the weighted-residual finite element method: integrals over the interior  of the domain,  and integrals over the boundary of the domain.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Consequently, in a typical simulation one would need  two meshes: one for the interior  of the domain,  and one for the boundary. Obviously, the one for the boundary will be derived from the mesh  constructed for the interior.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Often only a part  of the entire boundary   is   used:  on some parts of the boundary  the  boundary condition is implied as homogeneous (i. e. zero). For instance, a traction-free boundary. Therefore the necessary integrals are typically evaluated over a subset of the entire boundary.","category":"page"},{"location":"guide/guide.html#Manifold-dimension-1","page":"Guide","title":"Manifold dimension","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Finite elements  have  a certain manifold dimension.  Tetrahedra  and hexahedra are three-manifolds, triangles and quadrilaterals are two-manifolds, triangles and quadrilaterals are two-manifolds, lines are one-manifolds, and points are zero-manifolds.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Elements are equipped with an \"other\" dimension which boosts the manifold dimension to produce the required dimension for  the integration. For instance,  a line element can be equipped with an \"other\" dimension to represent a cross-section so that a volume integral can be evaluated over a line element. Or, a line element can be given an \"other\" dimension as a thickness to result in a physical dimension needed to evaluate a surface integral.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The \"other\"  dimension  has the following meaning  for finite elements of different manifold dimensions:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Manifold dimension Volume integral Surface integral\n3 NA NA\n2 Thickness NA\n1 Cross-section Thickness\n0 Volume Cross-section","category":"page"},{"location":"guide/guide.html#Integration-over-the-interior-1","page":"Guide","title":"Integration  over the interior","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The integrals are always  volume integrals. This means that for elements which are of  lower manifold dimension than three the \"other\"  dimension needs to compensate.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"For  three-manifold finite elements (tetrahedra and hexahedra) the \"other\" dimension is always 1.0. This really means there is no \"other\" dimension to a volume-like element.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"For  finite elements of manifold dimension  less than tthree, the  \"other\" dimension varies according to the model (axially symmetric versus simple  plane 2D) as shown  in the table below.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Manifold dimension Axially symmetric Plane 2D\n2 2pi r Thickness\n1 2pi rtimes  Thickness Cross-section\n0 2pi rtimes Cross-section Volume","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The integral  is approximated with numerical quadrature as","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"int_Omega f dV approx sum_q f(xi_q) J(xi_q) W_q","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Here f  is the integrand, f(xi_q)  is the  value of the integrand  at the quadrature point, J(xi_q)  is the  value of the Jacobian  at the quadrature point. Importantly, the Jacobian incorporates the \"other\" dimension,  and therefore it is the  volume Jacobian. (For the interior integrals the Jacobian  is computed by the Jacobianvolume method.)","category":"page"},{"location":"guide/guide.html#Integration-over-the-boundary-1","page":"Guide","title":"Integration  over the boundary","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The integrals are always  surface integrals. This means that for elements which are of  lower manifold dimension than two the \"other\"  dimension needs to compensate.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"For  two-manifold finite elements (triangles and quadrilaterals) the \"other\" dimension is always 1.0. This really means there is no \"other\" dimension to a surface-like element.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"For  finite elements of manifold dimension  less than two, the  \"other\" dimension varies according to the model (axially symmetric versus simple  plane 2D) as shown  in the table below.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Manifold dimension Axially symmetric Plane 2D\n1 2pi r Thickness\n0 2pi rtimes   Thickness Cross-section","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The integral  is approximated with numerical quadrature as","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"int_partial Omega f dS approx sum_q f(xi_q) J(xi_q) W_q  ","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Here f  is the integrand, f(xi_q) is the  value of the integrand  at the quadrature point, J(xi_q) is the  value of the Jacobian  at the quadrature point. Importantly, the Jacobian incorporates the \"other\" dimension,  and therefore it is the  surface Jacobian. (For the boundary integrals the Jacobian  is computed by the Jacobiansurface method.)","category":"page"},{"location":"guide/guide.html#Example:-axially-symmetric-model,-line-element-L2-1","page":"Guide","title":"Example: axially symmetric model, line element L2","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The surface Jacobian in this case  is  equal to the curve Jacobian times 2*pi*r.","category":"page"},{"location":"guide/guide.html#Integration-Data-1","page":"Guide","title":"Integration Data","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The  module IntegDomainModule supports  the processing of  the geometry necessary for the evaluation of the various integrals. The module data structure  groups together  a finite element set with an appropriate integration rule, information about the model (axially symmetric or not), and a callback to evaluate  the \"other\" dimension.","category":"page"},{"location":"guide/guide.html#Other-dimension-1","page":"Guide","title":"Other dimension","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The  discussion of the surface and volume integrals introduces the notion  of the  \"other\"  dimension. In order to evaluate Jacobians of various space dimensions  the  Geometry Data module takes into account  whether or not the model is axially symmetric, and evaluates the \"other\" dimension based upon this information.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"A finite element set is equipped with  a way of  calculating  the \"other\" dimension.  For instance, the line element with two nodes, L2, can be given  the \"other\" dimension  as a  \"thickness\"  so that  surface integrals  can be evaluated over the line element. However, if this line element  is used in an axially symmetric model, the same  \"other\" dimension  of \"thickness\"  will result in the integral  along the length of this line element  being a volume integral.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Thus, the way in which the \"other\"  dimension gets used by the Geometry Data methods depends on the model. As an example, consider  the  method","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"function Jacobianvolume(self::IntegDomain{T}, J::FFltMat, loc::FFltMat, conn::CC, N::FFltMat)::FFlt where {T<:AbstractFESet2Manifold, CC<:AbstractArray{FInt}}\n    Jac = Jacobiansurface(self, J, loc, conn, N)::FFlt\n    if self.axisymmetric\n        return Jac*2*pi*loc[1];\n    else\n        return Jac*self.otherdimension(loc, conn,  N)\n    end\nend","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"which  evaluates the volume Jacobian  for an element  of manifold dimension  2  (surface). Note that  first  the surface Jacobian  is calculated, which is then boosted to a volume Jacobian in two different ways, depending on whether  the model is axially symmetric or not. For the axially symmetric case  the \"other\"  dimension is implied,","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The callback function computes the \"other\" dimension from  two kinds of  information: (a) the physical location  of the quadrature point,  and (b) the interpolation data for the element  (connectivity and the values of the basis functions at the quadrature point).","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The approach ad (a) is suitable  when the \"other\" dimension is given as a function of the physical coordinates. The  simplest case is obviously  a uniform distribution of the \"other\" dimension. When  no  callback is explicitly provided,  the  \"other\"  dimension  callback is  automatically generated as the trivial","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"function otherdimensionunity(loc::FFltMat, conn::CC, N::FFltMat)::FFlt where {CC<:AbstractArray{FInt}}\n    return 1.0\nend","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"which simply returns 1.0 as the default value.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The approach ad (b) is appropriate when the \"other\" dimension  is given by values given at the nodes of the  mesh. Than the connectivity  and  the array of the values of the basis functions  can be used to interpolate the \"other\"  dimension  to the quadrature point.","category":"page"},{"location":"guide/guide.html#Evaluation-of-integration-data-1","page":"Guide","title":"Evaluation of integration data","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Importantly, the  Integration Domain (IntegDomain) method integrationdata evaluates quantities  needed for numerical integration: locations and weights of quadrature points, and the values of basis functions and of the basis function gradients with respect to the parametric coordinates at the quadrature points.","category":"page"},{"location":"guide/guide.html#FEM-machines-1","page":"Guide","title":"FEM machines","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The construction of the matrices and vectors of the discrete form of the weighted residual equation is performed in FEM  machines. (FEM = Finite Element Method.)","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"As an example consider the weighted-residual form of the heat balance equation","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"int_V  vartheta c_Vfracpartial Tpartial t  mathrmd V\n            +int_V(mathrmgradvartheta) kappa (mathrmgradT\n            )^T mathrmd V\n            -int_V  vartheta Q  mathrmd V  \n            +int_S_2 varthetaoverlineq_n mathrmd S+ int_S_3 varthetah\n            (T-T_a)   mathrmd S = 0","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"where vartheta(x) =0  for  x inS_1 .","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The  test function is  taken to be  one  finite element basis function at a time, vartheta = N_leftjright, and the trial function is","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"T = sum_i= 1 ^N N_leftiright T_i ","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Here by N_leftjright we mean the basis function constructed on the mesh and associated with the node leftjright. We use the notation inspected times two to mean node number at which the degree of freedom  j lives.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Now the test function and the trial function is substituted  into the  weighted residual equation.  ","category":"page"},{"location":"guide/guide.html#Example:-internal-heat-generation-rate-term-1","page":"Guide","title":"Example:  internal heat generation rate term","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"For instance,  for the term","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"int_V  vartheta Q  mathrmd V","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"we obtain","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"int_V N_leftjright Q  mathrmd V","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"This integral evaluates to a number, the heat load  applied to the degree of freedom j. When these numbers are evaluated for all  the free degrees of freedom,  they constitute the entries of the global heat load vector.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Evaluating integrals of this form is so common that there is a module FEMMBaseModule with the method distribloads that computes and assembles the global vector. For instance to evaluate this heat load vector  on the mesh composed of three-node triangles, for a uniform heat generation rate Q, we can write","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"fi = ForceIntensity(FFlt[Q]);\nF1 = distribloads(FEMMBase(IntegDomain(fes, TriRule(1))), geom, Temp, fi, 3);","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"IntegDomain(fes, TriRule(1)) constructs integration domain for the  finite elements fes using a triangular  integration rule with a single point. FEMMBase is the base  FEM  machine,  and all it needs at this point is the integration domain. The method  distribloads is defined for the  base FEM machine, the geometry field geom, the numbering of the degrees of freedom is taken from the field Temp, the internal heat generation rate is defined as the force intensity fi, and the integrals  are volume integrals  (3).","category":"page"},{"location":"guide/guide.html#Example:-conductivity-term-1","page":"Guide","title":"Example: conductivity term","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The conductivity term from the weighted residual equation","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"int_V(mathrmgradvartheta) kappa (mathrmgradT\n            )^T mathrmd V","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"is rewritten with the test and trial functions as","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"sum_i=1^N int_V(mathrmgradN_leftjright) kappa (mathrmgradN_leftiright\n            )^T mathrmd V  T_i","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The sum over the degree of freedom number i should be split: some of the  coefficients T_i are for free degrees of freedom (1 le i le  N_mathrmf, with N_mathrmf being the total number of free degrees of freedom), while some are  fixed (prescribed) for nodes  which are located on the essential boundary condition surface S_1  (N_mathrmf  i le N).","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Thus the term splits into two  pieces,","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"sum_i=1^N_mathrmf int_V(mathrmgradN_leftjright) kappa (mathrmgradN_leftiright\n            )^T mathrmd V  T_i","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"where the  individual integrals are entries of the conductivity matrix, and","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"sum_i=N_mathrmf+1^N int_V(mathrmgradN_leftjright) kappa (mathrmgradN_leftiright\n            )^T mathrmd V  T_i","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"which  will represent heat loads  due to nonzero  prescribed boundary condition.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The FEM machine  for heat conduction  can be created as","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"material = MatHeatDiff(thermal_conductivity)\nfemm = FEMMHeatDiff(IntegDomain(fes, TriRule(1)), material)","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"where we first create a material to  deliver the thermal conductivity matrix kappa, and then  we create  the FEM  machine  from the integration domain  for a mesh  consisting of three node triangles, using one-point integration rule, and the material. This  FEM machine  can then be passed to a method","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"K = conductivity(femm, geom, Temp)","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"to evaluate the global conductivity matrix K, where the geometry comes from the geometry field geom, and the temperature field Temp provides the  numbering of the degrees of freedom.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The heat load term  due to the  nonzero essential boundary conditions  is evaluated with the method nzebcloadsconductivity","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"F2 = nzebcloadsconductivity(femm, geom, Temp);","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"where the geometry comes from the geometry field geom, and the temperature field Temp provides the  numbering of the degrees of freedom and the values of the prescribed (fixed) degrees of freedom. The result is a contribution to the global heat load vector.","category":"page"},{"location":"guide/guide.html#Base-FEM-machine-1","page":"Guide","title":"Base FEM machine","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The following  operations are provided  by the base FEM machine:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Integrate  a function expressed in terms of a field. This is typically used  to  evaluate RMS discretization errors.\nIntegrate a function of the position. Perhaps the evaluation of the moments of inertia,  or the calculation of the volume.\nTransfer field between meshes of different resolutions.\nCalculate  the distributed-load system vector.\nConstruct a field  from integration-point quantities. This is typically used in the postprocessing phase, for instance to construct continuous distribution of stresses in the structure.","category":"page"},{"location":"guide/guide.html#Acoustics-FEM-machines-1","page":"Guide","title":"Acoustics FEM machines","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"There is one for  the interior integrals  and one for  boundary integrals. The  machine for the interior integrals can be used to compute:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Evaluate the acoustic-mass matrix and the acoustic-stiffness matrix.\nEvaluate the load vector corresponding to prescribed pressure  or the prescribed second order  rate of the pressure.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The machine for the boundary integrals can be used to compute:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Compute  transformation matrix to convert  pressure  to resultant force  or pressure to resultant torque.\nCompute the acoustic  ABC  (absorbing boundary condition) matrix.","category":"page"},{"location":"guide/guide.html#Heat-conduction-FEM-machines-1","page":"Guide","title":"Heat  conduction FEM machines","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"There is one for  the interior integrals  and one for  boundary integrals. The  machine for the interior integrals can be used to compute:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Evaluate the conductivity matrix.\nEvaluate the load vector corresponding to prescribed temperature.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The machine for the boundary integrals can be used to compute:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Compute surface heat transfer  matrix.\nCompute  the heat load vector for surface heat transfer.\nCompute the heat load vector  corresponding to prescribed temperatures on the boundary  with surface heat transfer.","category":"page"},{"location":"guide/guide.html#Linear-deformation-FEM-machines-1","page":"Guide","title":"Linear deformation FEM  machines","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"For  the base machine for linear deformation, FEMMDeforLinearBase, assumes standard isoparametric  finite elements. It evaluates  the interior integrals:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The stiffness matrix, the mass matrix.\nThe load vector corresponding to thermal strains.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Additionally:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Function to inspect  integration points.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The FEM machine FEMMDeforLinear simply stores the data required by the base FEMMDeforLinearBase.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The machine FEMMDeforWinkler is specialized for the boundary integrals for bodies  supported  on continuously distributed springs:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Compute the stiffness matrix corresponding to the springs.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The  mean-strain FEM machine FEMMDeforLinearMS implements advanced hexahedral and tetrahedral elements based on multi-field theory and  energy-sampling  stabilization. It provides functions to compute:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The stiffness matrix, the mass matrix.\nThe load vector corresponding to thermal strains.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Additionally it defines:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Function to inspect  integration points.","category":"page"},{"location":"guide/guide.html#Material-and-Material-Orientation-1","page":"Guide","title":"Material and Material Orientation","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The material response  is described in  material-point-attached coordinate system. These coordinate systems  are Cartesian, and the material coordinate system is typically chosen to make  the response particularly simple.  So for orthotropic or transversely isotropic materials the axes would be aligned with the axes of orthotropy.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The type CSys (module CSysModule) is the updater of the material coordinate system matrix. The object is equipped with a callback to store the current orientation matrix. For instance: the coordinate system for an orthotropic material wound around a cylinder could be described in the coordinate system CSys(3, 3, updatecs!), where the callback is defined as","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"function updatecs!(csmatout::FFltMat, XYZ::FFltMat, tangents::FFltMat, fe_label::FInt)\n    csmatout[:, 2] = [0.0 0.0 1.0]\n    csmatout[:, 3] = XYZ\n    csmatout[3, 3] = 0.0\n    csmatout[:, 3] = csmatout[:, 3]/norm(csmatout[:, 3])\n    csmatout[:, 1] = cross(csmatout[:, 2], csmatout[:, 3])\nend","category":"page"},{"location":"guide/guide.html#Materials-for-linear-deformation-analysis-1","page":"Guide","title":"Materials for linear deformation analysis","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The module MatDeforModule provides functions to convert between vector and matrix (tensor) representations of stress and strain. Further, functions to rotate stress and strain between different coordinate systems (based upon the model-reduction type, 3-D, 2-D, or 1-D) are provided.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Currently  there are material types for isotropic and orthotropic linear elastic materials. The user may add  additional material types by deriving from AbstractMatDefor and equipping them with three methods: (1) compute the tangent moduli, (2) update the material state, (3) compute the thermal strain.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"For full generality, material types  should implement these methods for fully three-dimensional, plane strain and plane stress, 2D axially symmetric, and one-dimensional deformation models.","category":"page"},{"location":"guide/guide.html#Algorithms-1","page":"Guide","title":"Algorithms","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Solution procedures and other  common operations on FEM models  are expressed  in algorithms. Anything that algorithms can do,  the user of FinEtools  can do manually, but to use an algorithm is convenient.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Algorithms typically (not always) accept a single argument, modeldata, a dictionary of data, keyed by Strings. Algorithms  also return modeldata,  typically  including additional key/value pairs that represent the data computed by the algorithm.","category":"page"},{"location":"guide/guide.html#Base-algorithms-1","page":"Guide","title":"Base algorithms","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"These are not specific to the particular physics at hand. Examples of  algorithms are  Richardson extrapolation,  calculation of the norm of the field, or calculation of the norm  of the difference of two fields. These algorithms are the exceptions, they do not return modeldata but rather return directly computed values.","category":"page"},{"location":"guide/guide.html#Acoustics-algorithms-1","page":"Guide","title":"Acoustics algorithms","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"At the moment there is one algorithm, for steady-state (harmonic) acoustics.","category":"page"},{"location":"guide/guide.html#Example:-baffled-piston-1","page":"Guide","title":"Example:  baffled piston","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"After the mesh  has been generated, the modeldata can be set up: Here we begin with  the region.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"material = MatAcoustFluid(bulk, rho)\nregion1 =  FDataDict(\"femm\"=>FEMMAcoust(IntegDomain(fes, GaussRule(3, 2)), material))","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"We set up a definition of the absorbing boundary condition:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"abc1  =  FDataDict(\"femm\"=>FEMMAcoustSurf(IntegDomain(outer_fes, GaussRule(2, 2)),\n          material))","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The  surface of the piston is associated with a known-flux  boundary condition:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"flux1  =  FDataDict(\"femm\"=>FEMMAcoustSurf(IntegDomain(piston_fes, GaussRule(2, 2)),\n          material),  \"normal_flux\"=> -rho*a_piston+0.0im);","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"And finally we make the model data,","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"modeldata =  FDataDict(\"fens\"=>  fens,\n                 \"omega\"=>omega,\n                 \"regions\"=>[region1],\n                 \"flux_bcs\"=>[flux1], \"ABCs\"=>[abc1])","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"and call  the solver:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"modeldata = FinEtools.AlgoAcoustModule.steadystate(modeldata)","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"When  the algorithm completes, modeldata[\"P\"] is the computed pressure field.","category":"page"},{"location":"guide/guide.html#Heat-diffusion-algorithms-1","page":"Guide","title":"Heat diffusion algorithms","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"There is an implementation of an algorithm for steady-state heat conduction.","category":"page"},{"location":"guide/guide.html#Linear-deformation-algorithms-1","page":"Guide","title":"Linear deformation algorithms","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"There are algorithms for","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Linear static analysis;\nExport  of the deformed shape for visualization;\nExport  of the nodal and elementwise stress fields for visualization;\nModal (free-vibration) analysis;\nExport  of modal shapes for visualization;\nSubspace-iteration method implementation.","category":"page"},{"location":"guide/guide.html#Model-data-1","page":"Guide","title":"Model data","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Model data is a dictionary, with string keys, and arbitrary values. The documentation string for each method of an algorithm lists the required input. For instance, for the method linearstatics of the AlgoDeforLinearModule, the modeldata dictionary needs to provide key-value pairs for the finite element node set, and the regions, the boundary conditions, and so on.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The modeldata may be also supplemented with additional key-value pairs inside an algorithm and returned for further processing by other algorithms.","category":"page"},{"location":"guide/guide.html#Queries-of-quadrature-point-data-1","page":"Guide","title":"Queries of quadrature-point data","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"NEEDS  TO BE WRITTEN","category":"page"},{"location":"guide/guide.html#Postprocessing-1","page":"Guide","title":"Postprocessing","text":"","category":"section"},{"location":"guide/guide.html#Compute-continuous-stress-fields-1","page":"Guide","title":"Compute continuous stress fields","text":"","category":"section"},{"location":"guide/guide.html#Compute-elementwise-stress-fields-1","page":"Guide","title":"Compute elementwise stress fields","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"NEEDS  TO BE WRITTEN","category":"page"},{"location":"guide/guide.html#Import/export-1","page":"Guide","title":"Import/export","text":"","category":"section"},{"location":"guide/guide.html#Importing-1","page":"Guide","title":"Importing","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"At the moment importing is mostly limited to the mesh data (properties, boundary conditions, analysis of data, etc. are typically not imported). The following formats of finite element input files can be handled:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"NASTRAN (.nas files).\nAbaqus (.inp files).","category":"page"},{"location":"guide/guide.html#Exporting-1","page":"Guide","title":"Exporting","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"VTK (.vtk so-called legacy files). Export of geometry and fields (nodal and elemental) is supported.\nAbaqus (.inp files). Mesh data and selected property, boundary condition, and procedure commands can be handled.\nNASTRAN (.nas files). Very basic mesh and select other attributes are handled.\nSTL file export of surface data.\nH2Lib triangular-surface export (.tri files).\nCSV file export of numerical data is supported.","category":"page"},{"location":"guide/guide.html#Tutorials-and-Examples-1","page":"Guide","title":"Tutorials and Examples","text":"","category":"section"},{"location":"guide/guide.html#Tutorials-1","page":"Guide","title":"Tutorials","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The FinEtools tutorials are written up in their own separate repository, FinEtoolsTutorials.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The tutorials are in the form of Julia files with markdown. These are converted to markdown files (or to Jupyter notebooks) using the Literate workflow.","category":"page"},{"location":"guide/guide.html#Examples-1","page":"Guide","title":"Examples","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The FinEtools examples are separated in their own separate repositories, FinEtoolsHeatConductionExamples, FinEtoolsAcousticsExamples, FinEtoolsLinearDeformationExamples, FinEtoolsMeshGenerationExamples.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The examples are in the form of  Julia files with multiple functions, where each function defines one example. Take for instance the example file Fahy_examples.jl. This incantation will run all the examples from the example file:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"include(\"Fahy_examples.jl\"); Fahy_examples.allrun()","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"This will run just a single example from this file:","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"include(\"Fahy_examples.jl\"); Fahy_examples.fahy_H8_example()","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The example file Fahy_examples.jl consists of a module (whose name matches the name of the file), and  the module defines multiple functions,  one for each example, and one to run all examples, allrun.","category":"page"},{"location":"guide/guide.html#Tests-1","page":"Guide","title":"Tests","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Check out the numerous tests in the test folder. There are hundreds of tests which exercise the various functions of the library. These examples may help you understand how to extract the desired outcome.","category":"page"},{"location":"guide/guide.html#Make-up-your-own-public-interface-1","page":"Guide","title":"Make up your own public interface","text":"","category":"section"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Here we assume that the FinEtools package is installed. We also assume the user works in his or her own folder, which for simplicity we assume is a package folder in the same tree as the package folder for FinEtools.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The user may have his or her additions to the FinEtools library, for instance a new material implementation, or a new FEMM (finite element model machine). Additionally, the user writes some code to solve particular problems.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"In order to facilitate interactive work at the command line(REPL), it is convenient to have one or two modules so that using them allows for the user's code to resolve function names from the FinEtools package and from the user's own code.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Here are two ways in which this can be accomplished.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"The user exports his or her own additions from the module add2FinEtools (the name of this module is not obligatory, it can be anything). In addition, the public interface to the FinEtools package needs to be brought in separately.\nusing FinEtools  using add2FinEtools\nThe user may change entirely the public interface to the FinEtools package by selectively including parts of the FinEtools.jl file and the code to export his or her own functionality in a single module, let us say myFinEtools (this name is arbitrary), so that when the user invokes\nusing myFinEtools\nall the functionality that the USER considers to be public is made available by exports.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Method 1 has the advantage that the interface definition of the FinEtools package itself does not change, which means that package code does not need to be touched. It also has a disadvantage that the interface to FinEtools does not change which means that if there is a conflict with one of the exported functions from FinEtools, it needs to be resolved by fiddling with other packages.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"Method 2 has the advantage that when there is a conflict between one of the exported FinEtools functions and some other function, be it from another package or the user's own, the conflict can be resolved by changing the public interface to FinEtools by the USER (as opposed to  by the DEVELOPER). Also, in this method the USER has the power to define the public interface to the FinEtools package, and if the user decides that nothing should be exported for implicit resolution of functions, that is easily accomplished.","category":"page"},{"location":"guide/guide.html#","page":"Guide","title":"Guide","text":"These two methods have been described by examples in the FinEtoolsUseCase package. Refer to the Readme  file and to the method descriptions  in the  method 1 and 2 folders.","category":"page"},{"location":"man/types.html#Types-1","page":"Types","title":"Types","text":"","category":"section"},{"location":"man/types.html#FEM-machines-1","page":"Types","title":"FEM machines","text":"","category":"section"},{"location":"man/types.html#Linear-deformation-1","page":"Types","title":"Linear deformation","text":"","category":"section"},{"location":"man/types.html#","page":"Types","title":"Types","text":"Modules = [FinEtools, FinEtoolsDeforLinear.DeforModelRedModule, FinEtoolsDeforLinear.FEMMDeforLinearBaseModule, FinEtoolsDeforLinear.FEMMDeforLinearModule, FinEtoolsDeforLinear.FEMMDeforWinklerModule, FinEtoolsDeforLinear.FEMMDeforLinearMSModule, FinEtoolsDeforLinear.FEMMDeforSurfaceDampingModule, FinEtoolsDeforLinear.FEMMDeforLinearNICEModule, FinEtoolsDeforLinear.FEMMDeforLinearESNICEModule]\nPrivate = true\nOrder = [:type]","category":"page"},{"location":"man/types.html#Material-models-1","page":"Types","title":"Material models","text":"","category":"section"},{"location":"man/types.html#Material-for-deformation,-base-functionality-1","page":"Types","title":"Material for deformation, base functionality","text":"","category":"section"},{"location":"man/types.html#","page":"Types","title":"Types","text":"Modules = [FinEtools, FinEtoolsDeforLinear.MatDeforModule]\nPrivate = true\nOrder = [:type]","category":"page"},{"location":"man/types.html#Material-models-for-elasticity-1","page":"Types","title":"Material models for elasticity","text":"","category":"section"},{"location":"man/types.html#","page":"Types","title":"Types","text":"Modules = [FinEtools, FinEtoolsDeforLinear.MatDeforLinearElasticModule, FinEtoolsDeforLinear.MatDeforElastIsoModule, FinEtoolsDeforLinear.MatDeforElastOrthoModule,]\nPrivate = true\nOrder = [:type]","category":"page"},{"location":"man/functions.html#Functions-1","page":"Functions","title":"Functions","text":"","category":"section"},{"location":"man/functions.html#FEM-machines-1","page":"Functions","title":"FEM machines","text":"","category":"section"},{"location":"man/functions.html#Linear-deformation-1","page":"Functions","title":"Linear deformation","text":"","category":"section"},{"location":"man/functions.html#Model-reduction-types-1","page":"Functions","title":"Model reduction types","text":"","category":"section"},{"location":"man/functions.html#","page":"Functions","title":"Functions","text":"Modules = [FinEtools, FinEtoolsDeforLinear.DeforModelRedModule]\nPrivate = true\nOrder = [:function]","category":"page"},{"location":"man/functions.html#Base-functionality-1","page":"Functions","title":"Base functionality","text":"","category":"section"},{"location":"man/functions.html#","page":"Functions","title":"Functions","text":"Modules = [FinEtools, FinEtoolsDeforLinear.FEMMDeforLinearBaseModule, FinEtoolsDeforLinear.FEMMDeforLinearModule, FinEtoolsDeforLinear.FEMMDeforWinklerModule, FinEtoolsDeforLinear.FEMMDeforLinearMSModule, FinEtoolsDeforLinear.FEMMDeforSurfaceDampingModule, FinEtoolsDeforLinear.FEMMDeforLinearNICEModule, FinEtoolsDeforLinear.FEMMDeforLinearESNICEModule]\nPrivate = true\nOrder = [:function]","category":"page"},{"location":"man/functions.html#Simple-FE-models-1","page":"Functions","title":"Simple FE models","text":"","category":"section"},{"location":"man/functions.html#","page":"Functions","title":"Functions","text":"Modules = [FinEtools, FinEtoolsDeforLinear.FEMMDeforLinearModule, FinEtoolsDeforLinear.FEMMDeforWinklerModule,  FinEtoolsDeforLinear.FEMMDeforSurfaceDampingModule, ]\nPrivate = true\nOrder = [:function]","category":"page"},{"location":"man/functions.html#Advanced-FE-models-1","page":"Functions","title":"Advanced FE models","text":"","category":"section"},{"location":"man/functions.html#","page":"Functions","title":"Functions","text":"Modules = [FinEtools, FinEtoolsDeforLinear.FEMMDeforLinearMSModule, FinEtoolsDeforLinear.FEMMDeforLinearNICEModule, FinEtoolsDeforLinear.FEMMDeforLinearESNICEModule]\nPrivate = true\nOrder = [:function]","category":"page"},{"location":"man/functions.html#Algorithms-1","page":"Functions","title":"Algorithms","text":"","category":"section"},{"location":"man/functions.html#Linear-deformation-2","page":"Functions","title":"Linear deformation","text":"","category":"section"},{"location":"man/functions.html#","page":"Functions","title":"Functions","text":"Modules = [FinEtools, FinEtoolsDeforLinear.AlgoDeforLinearModule]\nPrivate = true\nOrder = [:function]","category":"page"},{"location":"man/functions.html#Material-models-1","page":"Functions","title":"Material models","text":"","category":"section"},{"location":"man/functions.html#Material-for-deformation,-base-functionality-1","page":"Functions","title":"Material for deformation, base functionality","text":"","category":"section"},{"location":"man/functions.html#","page":"Functions","title":"Functions","text":"Modules = [FinEtools, FinEtoolsDeforLinear.MatDeforModule]\nPrivate = true\nOrder = [:function]","category":"page"},{"location":"man/functions.html#Material-models-for-elasticity-1","page":"Functions","title":"Material models for elasticity","text":"","category":"section"},{"location":"man/functions.html#","page":"Functions","title":"Functions","text":"Modules = [FinEtools, FinEtoolsDeforLinear.MatDeforLinearElasticModule, FinEtoolsDeforLinear.MatDeforElastIsoModule, FinEtoolsDeforLinear.MatDeforElastOrthoModule,]\nPrivate = true\nOrder = [:function]","category":"page"}]
}
